window.bookSummaryJSON = "<p>I've been given 30 days to prove my love to another immortal - as a human. Cursed to use nothing but the side of myself I've always despised to win her affection. I am Cassius, the King of the immortals, A Dark One. And today I tasted fear for the first time.</p> <p>How can I win her when my human emotions over take every ounce of logic I possess? A darkness is brewing. One I cannot stop as a human. One that Stephanie, my love's visions, have shown, will be my end.</p> <p>Thirty days ago I was King of the immortals. Today I know fear. Today I know how I will die. By her hand. The woman I love.</p> <p>Contains mature themes.</p>"; 
